import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar'; // Navbar
import Home from './components/Home'; // Ana Sayfa
// import Products from './components/Products'; // Ürünler Sayfası
// import About from './components/About'; // Hakkımızda Sayfası
// import Contact from './components/Contact'; // İletişim Sayfası
// import Login from './components/Login'; // Giriş Yap Sayfası

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/urunler" element={<Products />} />
        <Route path="/hakkimizda" element={<About />} />
        <Route path="/iletisim" element={<Contact />} />
        <Route path="/giris-yap" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
